import React from "react";
import firebase from './config';

import {BrowserRouter as Router, Route, Link, Redirect, withRouter} from "react-router-dom";
import Login from "./auth/Login";
import Signup from "./auth/SignUp";
import MyProfile from "./component/MyProfile";
import ChangePassword from "./component/changepassword";

import Dashboard from "./component/dashboard";
import AddMerchantPage from "./component/add_merchant";
import AddProductPage from "./component/add_product";
import AddCategoryPage from "./component/add_category";
import MerchantListPage from "./component/merchant_list";
import ProductListPage from "./component/product_list";
import CategoryListPage from "./component/category_list";
import EditCategoryPage from "./component/edit_category";
import EditMerchantPage from "./component/edit_merchant";
import EditProductPage from "./component/edit_product";
import ProductListView from "./component/product_list_view";

//GSt
import AddGSTPage from "./component/add_GST";
import GSTListPage from "./component/GST_list";
import EditGSTPage from "./component/edit_GST";

//Role
import AddRolePage from "./component/add_Role";
import RoleListPage from "./component/Role_list";
import EditRolePage from "./component/edit_Role";
//pin code
import AddPinCode from "./component/AddPinCode";
import PincodeList from "./component/PincodeList";
import EditPinCode from "./component/EditPinCode";

//shipping charges
import ShippingCharges from "./component/ShippingCharges";
import EditShippingCharge from "./component/EditShippingCharge";

//Sub Category Pages

import AddSubCategoryPage from "./component/add_sub_category";
import SubCategoryListPage from "./component/sub_category_list";
import EditSubCategoryPage from "./component/edit_sub_category";
//Orders Pages
import OrderListPage from "./component/order_list";
import OrderListNew from "./component/order_list_new";
import OrderListPending from "./component/order_list_pending";
import OrderListProcessing from "./component/order_list_processing";
import OrderListDispatch from "./component/order_list_dispatch";
import OrderListDelivered from "./component/order_list_delivered";
import OrderListCompleted from "./component/order_list_completed";
import OrderListCancelled from "./component/order_list_cancelled";
import OrderListRefund from "./component/order_list_refund";
import InvoicesListPage from "./component/invoices_list";
import ViewInvoice from "./component/view_invoice";

import InvoicesList from "./component/InvoicesList";
//GoogleAnalytics Pages
import GoogleAnalytics from "./component/googleanalytics";

//CMS Pages
import ADDCMSPAGES from "./component/addcmspage";
import CMSPAGES from "./component/cmspages";
import EDITCMSPAGES from "./component/editcmspage";
//Notification Pages
import AddNotifications from "./component/AddNotifications";
import Notifications from "./component/Notifications";
import EditNotification from "./component/EditNotification";

//SEO Pages
import ADDSEOPAGES from "./component/addseopage";
import SEOPAGES from "./component/seopages";
import EDITSEOPAGES from "./component/editseopage";

//Blog Pages
import ADDBLOG from "./component/addblog";
import BLOG from "./component/blog";
import EDITBLOG from "./component/editblog";

//Footer Link Pages
import AddFooterLinks from "./component/AddFooterLinks";
import FooterLinks from "./component/FooterLinks";
import EditFooterLInks from "./component/EditFooterLInks";

//Slider Pages
import AddSlider from "./component/addSlider";
import Slider from "./component/Slider";
import EditSlider from "./component/editSlider";
//Sub Slider Pages
import AddSubSlider from "./component/AddSubSlider";
import SubSliderList from "./component/SubSliderList";
import EditSubSlider from "./component/EditSubSlider";
//Multiple Slider Pages
import MultipleSliderList from "./component/MultipleSliderList";
import AddMultipleSlider from "./component/AddMultipleSlider";
import EditMultipleSlider from "./component/EditMultipleSlider";
//Coupon Pages
import ADDCOUPON from "./component/addcoupon";
import COUPONS from "./component/coupons";
import EDITCOUPON from "./component/editcoupon";
//Merchant Pages
import MerchantAccount from "./component/merchantAccount";
import EditMerchantAccount from "./component/editMerchantAccount";
import AddMerchantAccount from "./component/addMerchantAccount";
//Admin Pages
import AdminStaff from "./component/AdminStaff";
import EditAdminStaff from "./component/EditAdminStaff";
import AddAdminStaff from "./component/AddAdminStaff";

import ServiceProviderListPage from "./component/service_provider_list";
import EditServicePage from "./component/edit_service";
import AddServicePage from "./component/add_service";

import SiteSettingListPage from "./component/site_setting_list";
import EditSitePage from "./component/edit_site";
import AddSitePage from "./component/add_site";

import EmailContentListPage from "./component/email_content_list";
import EditEmailContentPage from "./component/edit_email_content";
import AddEmailContentPage from "./component/add_email_content";

//Social Accounts
import SocialAccounts from "./component/social_list";
import EditSocialAccount from "./component/edit_social";
import AddSocialAccount from "./component/add_social";
import EditCoupon from "./component/editcoupon";

import WEBSITEENQUIRIES from "./component/websiteEnquiries";
import viewEnquiries from "./component/viewEnquiries";
import ViewMerchantDetails from "./component/ViewMerchantDetails";

//STAFF MAGEMENT Accounts
import STAFF from "./component/staff";
import EDITSTAFF from "./component/editstaff";
import ADDSTAFF from "./component/addstaff";

//Customers
import USERS from "./component/users";
import VIEWUSERS from "./component/viewuser";
import VIEWUSERORDERS from "./component/user_order_list";

import MerchantOrders from "./component/merchant_order_list";

import AddAccountDetails from "./component/AddAccountDetails";
import MerchantPaymentsList from "./component/MerchantPaymentsList";

export const PrivateRoute = ({
    component: Component,
    ...rest
}) => (
    <Route
        {...rest}
        render={props => sessionStorage.getItem("RoleId")
        ? (<Component {...props}/>)
        : (<Redirect
            to={{
            pathname: "/login",
            state: {
                from: props.location
            }
        }}/>)}/>
);

class Routing extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

            orderStatusList: []
        };
    }
    componentDidMount() {

        this.setState({loading: true});
        var ref = firebase
            .database()
            .ref("orderStatus");

        ref.on('value', snapshot => {
            const data = [];

            snapshot.forEach(childSnapShot => {

                const orderStatus = {
                    categoryId: childSnapShot
                        .key
                        .toString(),
                    orderStatus: childSnapShot
                        .val()
                        .orderStatus
                };

                data.push(orderStatus);
            });

            this.setState({orderStatusList: data, loading: false});
            console.log(this.state.orderStatusList);
        });
    }

    render() {
        return (
            <Router>
                <div className="site-wrapper">
                    <Route exact strict path="/" component={Login}/>

                    <Route path="/login" component={Login}/>
                    <Route path="/Signup" component={Signup}/>
                    <PrivateRoute path="/MyProfile" component={MyProfile}/>
                    <PrivateRoute path="/ChangePassword" component={ChangePassword}/>

                    <PrivateRoute path="/Dashboard" component={Dashboard}/>
                    <PrivateRoute path="/AddMerchantPage" component={AddMerchantPage}/>
                    <PrivateRoute path="/AddProductPage" component={AddProductPage}/>
                    <PrivateRoute path="/AddCategoryPage" component={AddCategoryPage}/>
                    <PrivateRoute path="/MerchantListPage" component={MerchantListPage}/>
                    <PrivateRoute path="/ProductListPage" component={ProductListPage}/>

                    <PrivateRoute path="/CategoryListPage" component={CategoryListPage}/>
                    <PrivateRoute path="/AddGSTPage" component={AddGSTPage}/>
                    <PrivateRoute path="/GSTListPage" component={GSTListPage}/>
                    <PrivateRoute path="/EditGSTPage/:GstID" component={EditGSTPage}/>

                    <PrivateRoute path="/AddRolePage" component={AddRolePage}/>
                    <PrivateRoute path="/RoleListPage" component={RoleListPage}/>
                    <PrivateRoute path="/EditRolePage/:GstID" component={EditRolePage}/>

                    <PrivateRoute path="/AddPinCode" component={AddPinCode}/>
                    <PrivateRoute path="/PincodeList" component={PincodeList}/>
                    <PrivateRoute path="/EditPinCode/:GstID" component={EditPinCode}/>

                    <PrivateRoute path="/ShippingCharges" component={ShippingCharges}/>
                    <PrivateRoute path="/EditShippingCharge/:GstID" component={EditShippingCharge}/>

                    <PrivateRoute path="/SubCategoryListPage" component={SubCategoryListPage}/>
                    <PrivateRoute path="/AddSubCategoryPage" component={AddSubCategoryPage}/>

                    <PrivateRoute path="/AddSocialAccount" component={AddSocialAccount}/>
                    <PrivateRoute path="/SocialAccounts" component={SocialAccounts}/> {/* <PrivateRoute path="/OrderListPage" component={OrderListPage} /> */}
                    <PrivateRoute path="/OrderListNew" component={OrderListNew}/>
                    <PrivateRoute path="/OrderListPending" component={OrderListPending}/>
                    <PrivateRoute path="/OrderListDispatch" component={OrderListDispatch}/>
                    <PrivateRoute path="/OrderListDelivered" component={OrderListDelivered}/>
                    <PrivateRoute path="/OrderListCompleted" component={OrderListCompleted}/>
                    <PrivateRoute path="/OrderListCancelled" component={OrderListCancelled}/>
                    <PrivateRoute path="/OrderListRefund" component={OrderListRefund}/>
                    <PrivateRoute path="/OrderListProcessing" component={OrderListProcessing}/>
                    <PrivateRoute path="/Invoices" component={InvoicesList}/>

                    <PrivateRoute
                        path="/EditCategoryPage/:categoryID"
                        component={EditCategoryPage}/>
                    <PrivateRoute
                        path="/EditSubCategoryPage/:categoryID"
                        component={EditSubCategoryPage}/>
                    <PrivateRoute path="/EditProductPage/:productID" component={EditProductPage}/>
                    <PrivateRoute path="/ProductListView/:productID" component={ProductListView}/>
                    <PrivateRoute
                        path="/EditMerchantPage/:merchantID"
                        component={EditMerchantPage}/>

                    <PrivateRoute
                        path="/EditSocialAccount/:SocilaID"
                        component={EditSocialAccount}/>
                    <PrivateRoute path="/AddServicePage" component={AddServicePage}/>
                    <PrivateRoute
                        path="/ServiceProviderListPage"
                        component={ServiceProviderListPage}/>
                    <PrivateRoute path="/EditServicePage/:serviceID" component={EditServicePage}/>

                    <PrivateRoute path="/AddSitePage" component={AddSitePage}/>
                    <PrivateRoute path="/SiteSettingListPage" component={SiteSettingListPage}/>
                    <PrivateRoute path="/EditSitePage/:siteID" component={EditSitePage}/>

                    <PrivateRoute path="/AddEmailContentPage" component={AddEmailContentPage}/>
                    <PrivateRoute path="/EmailContentListPage" component={EmailContentListPage}/>
                    <PrivateRoute
                        path="/EditEmailContentPage/:emailContentId"
                        component={EditEmailContentPage}/>
                    <PrivateRoute path="/InvoicesListPage" component={InvoicesListPage}/>
                    <PrivateRoute path="/ViewInvoice/:orderID" component={ViewInvoice}/>
                    <PrivateRoute path="/GoogleAnalytics" component={GoogleAnalytics}/>

                    <PrivateRoute path="/CmsPages" component={CMSPAGES}/>
                    <PrivateRoute path="/AddCMSPage" component={ADDCMSPAGES}/>
                    <PrivateRoute path="/EditCMSPage/:CMSID" component={EDITCMSPAGES}/>

                    <PrivateRoute path="/Notifications" component={Notifications}/>
                    <PrivateRoute path="/AddNotifications" component={AddNotifications}/>
                    <PrivateRoute path="/EditNotification/:CMSID" component={EditNotification}/>

                    <PrivateRoute path="/FooterLinks" component={FooterLinks}/>
                    <PrivateRoute path="/AddFooterLinks" component={AddFooterLinks}/>
                    <PrivateRoute path="/EditFooterLInks/:CMSID" component={EditFooterLInks}/>

                    <PrivateRoute path="/Blog" component={BLOG}/>
                    <PrivateRoute path="/AddBlog" component={ADDBLOG}/>
                    <PrivateRoute path="/EditBlog/:CMSID" component={EDITBLOG}/>

                    <PrivateRoute path="/Slider" component={Slider}/>
                    <PrivateRoute path="/AddSlider" component={AddSlider}/>
                    <PrivateRoute path="/EditSlider/:CMSID" component={EditSlider}/>

                    <PrivateRoute path="/SubSliderList" component={SubSliderList}/>
                    <PrivateRoute path="/AddSubSlider" component={AddSubSlider}/>
                    <PrivateRoute path="/EditSubSlider/:CMSID" component={EditSubSlider}/>

                    <PrivateRoute path="/MultipleSliderList" component={MultipleSliderList}/>
                    <PrivateRoute path="/AddMultipleSlider" component={AddMultipleSlider}/>
                    <PrivateRoute path="/EditMultipleSlider/:CMSID" component={EditMultipleSlider}/>

                    <PrivateRoute path="/SEOPages" component={SEOPAGES}/>
                    <PrivateRoute path="/AddSEOPage" component={ADDSEOPAGES}/>
                    <PrivateRoute path="/EditSEOPage/:CMSID" component={EDITSEOPAGES}/>

                    <PrivateRoute path="/Coupons" component={COUPONS}/>
                    <PrivateRoute path="/AddCoupon" component={ADDCOUPON}/>
                    <PrivateRoute path="/EditCoupon/:CMSID" component={EditCoupon}/>

                    <PrivateRoute path="/websiteEnquiries" component={WEBSITEENQUIRIES}/>
                    <PrivateRoute path="/viewEnquiries/:CMSID" component={viewEnquiries}/>

                    <PrivateRoute path="/Staff" component={STAFF}/>
                    <PrivateRoute path="/AddStaff" component={ADDSTAFF}/>
                    <PrivateRoute path="/EditStaff/:CMSID" component={EDITSTAFF}/>

                    <PrivateRoute path="/MerchantAccount" component={MerchantAccount}/>
                    <PrivateRoute path="/AddMerchantAccount" component={AddMerchantAccount}/>
                    <PrivateRoute
                        path="/EditMerchantAccount/:CMSID"
                        component={EditMerchantAccount}/>

                    <PrivateRoute path="/AdminStaff" component={AdminStaff}/>
                    <PrivateRoute path="/AddAdminStaff" component={AddAdminStaff}/>
                    <PrivateRoute path="/EditAdminStaff/:CMSID" component={EditAdminStaff}/>

                    <PrivateRoute path="/Users" component={USERS}/>
                    <PrivateRoute path="/ViewUser/:CMSID" component={VIEWUSERS}/>
                    <PrivateRoute path="/ViewOrders/:CMSID" component={VIEWUSERORDERS}/>
                    <PrivateRoute path="/MerchantOrders/:CMSID" component={MerchantOrders}/>
                    <PrivateRoute
                        path="/ViewMerchantDetails/:CMSID"
                        component={ViewMerchantDetails}/>

                    <PrivateRoute path="/MerchantAccountDetails" component={AddAccountDetails}/>
                    <PrivateRoute path="/MerchantPaymentsList" component={MerchantPaymentsList}/>
                    <PrivateRoute path="/orders/All" component={OrderListPage}/> {this
                        .state
                        .orderStatusList
                        .map((data, index) => {
                            console.log(data);

                            return (<PrivateRoute
                                path={'/orders/' + data.orderStatus}
                                component={OrderListPage}
                                key={index}/>)

                        })}

                </div>
            </Router>
        );
    }
}

export default Routing;
